  const[form,setForm]=useState(false)
  const [videolist,setVideolist]=useState(exampleresponse)

  return (
    <div className="container">
      <button onClick={()=>setForm(!form)}>Add Video</button>
      <Form form={form}/>
      <div className="row">

   {videolist.map((item,key)=> {return <div className="col-6 col-md-4">
    <Card key={item.id} item={item} setVideolist={setVideolist}/></div>


   })}
   </div>
    </div>
  );
}

export default App;
